import React, { Component } from 'react'
import {Button} from "../../components/Button"
import "./login.css"

class Login extends Component {
    constructor(props){
        super(props);
        this.state = {}
    }

    render(){
        return(
            <div
                style={{
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                height: '90vh'
                }}
            >
                <form>
                    <ul>
                        <li><h2>Input Username</h2></li>
                        <li>
                            <input 
                            style={{
                                width:"300px", 
                                height:"40px",
                                borderRadius:"45px",
                                border:"1px solid"
                            }}
                            type="text"
                            placeholder="   input username   "
                            />
                        </li>
                        <li><h2>Input Password</h2></li>
                        <li>
                            <input 
                            style={{
                                width:"300px", 
                                height:"40px",
                                borderRadius:"45px",
                                border:"1px solid"
                            }}
                            type="password"
                            placeholder="    Input password   "
                            />
                        </li>
                        <li><Button>Login</Button></li>
                    </ul>
                </form>
            </div>
        )
    }
}

export default Login;
